import React from 'react';

const About = () => (
  <div>
  <h1>Education</h1>
  <p>St. Cloud State University – St. Cloud MN</p>
  <p>Bachelor of Arts – Business Information systems, Dec 2009</p>
  <p>BCIS Club - St. Cloud MN, Nominated as Vice President in 2008, 2006 - 2009</p>
</div>
);

export default About;
